import React from "react";
import { Switch, Route } from "react-router-dom";
import Landing from "./components/Landing";
import "tailwindcss/tailwind.css";

const App = () => {
  return (
    <div>
        <Switch>
          <Route path="/" component={Landing} />
        </Switch>
    </div>
  );
};

export default App;
